response.about:
•Создатель и ведущая курсов женской школы «Откровение»;
•Дипломированный психолог и коуч с опытом более 13 лет;
•Гипнотерапевт;
•Исследователь сакральных знаний и практик разных культур и народностей;
•Создатель эффективных курсов, которые прошли более 4000 женщин со всего мира;
•Провела более 200 выездных программ в России, Индийских Гималаях, Италии, Германии, Австралии, Америке, Коста-Рике, Индонезии.
•Автор многочисленных публикаций на тему женского исцеления;
•Исполнительница священных мантр.
